<strong>Thời gian:</strong> Thu thập dữ liệu trong 1 – 2  năm và 2 tháng để phân tích dữ liệu<br>
<strong>Đối tượng:</strong> Những người đang điều trị và những người không mắc bệnh. Dựa trên các chỉ số lâm sàn của 2 nhóm này từ đó tìm ra những điểm khác biệt và mối liên hệ.<br>
<ul>
<li>P: Những người bị bệnh đột quỵ và những người không bị bệnh đột quỵ tại Việt Nam</li>
<li>A: Các đối tượng bị bệnh đột quỵ và những người không bị bệnh đột quỵ ở thành phố Hồ Chí Minh</li>
<li>S: Những bệnh nhân đang điều trị bệnh đột quỵ hoặc theo dõi sức khỏe tại các bệnh viện ở thành phố Hồ Chí Minh</li>
