  line-height: 80px;
  background-position: 0 100%;"> 3.1. Mối tương quan giữa bmi và chỉ số đường huyết trung bình: </h1>

<div class="box_luuy" style="background: #66689c; box-shadow: rgba(0, 0, 0, 0.1) 3px 4px 4px; clear: both; line-height: 2; color: white; font-size:20px ; letter-spacing: -0.75px; margin: 5px 0px; padding: 20px 25px; transition: 0.5s;">
<ul>
<li>Chỉ số BMI theo phân loại quốc tế (WHO) thì dưới 18,5 là nhẹ cân, 18,5-24,9 là bình thường, 25-29,9 là thừa cân và từ 30 trở lên là béo phì.</li>
<li>Béo phì có thể làm cho các tế bào của cơ thể đề kháng với insulin. Insulin là một loại hormone mang đường từ máu đến các tế bào trong cơ thể của bạn, nơi nó được sử dụng để tạo năng lượng. Nếu bạn đề kháng với insulin, đường không thể được các tế bào hấp thụ, dẫn đến lượng đường trong máu cao.</li>
<li>Theo Thư viện Y khoa Quốc gia Hoa Kỳ, nghiên cứu về mối tương quan giữa chỉ số bmi và đường huyết ở bệnh nhân tiểu đường và không tiểu đường đã chỉ ra rằng những người mắc bệnh tiểu đường có chỉ số bmi và lượng đường cao hơn so với nhóm không mắc bệnh.</li>
<li>Kiểm định tính xác thực, ta chia bộ dữ liệu thành 3 nhóm dựa trên chỉ số đường huyết trung bình: bình thường (đường huyết < 140), tiền tiểu đường (140 ≤ đường huyết < 200) và tiểu đường (đường huyết ≥ 200). Quan sát những thay đổi về chỉ số bmi giữa 3 nhóm này.</li>
</ul>
</div>

